import React,{useEffect} from 'react';
import './App.css';

 const App = () => {
   const APP_KEY = "1e3c443b-d0f6-4d63-88fe-7ceae1e519b1";

  useEffect(() => {
    getData();
  }, []);

   const getData = async () => {
     const response = await fetch(`https://pro-api.coinmarketcap.com/v1/cryptocurrency/listings/latest?KEY=${APP_KEY}`);
     const data = await response.json();
     console.log(data);
   }
  return (
    <div>
      <PageHead />
    </div>
  );
}

function PageHead() {
  return(
    <div className="App">
      <h1>Crypto Wallet</h1>
      <p>Latest BitCoin Price:</p>
      <p>Latest XRP Price:</p>
    </div>
  );
}

export default App;
